import React from "react";

const NewBlog = ({ blog }) => {
  console.log(blog);
  const { que, details } = blog;
  return (
    <div className="p-4 text-center border-2 m-3 rounded-xl">
      <h2 className="text-2xl font-medium bg-lime-400">{que}</h2>
      <p className="text-justify">{details}</p>
    </div>
  );
};

export default NewBlog;
